import React from "react";
import Back from "../images/returnicon.png";

function salary() {
	return (
		<div className='title-box-create-employee'>
			<h1 className='create-employee-title'>New Employee</h1>
			<img src={Back} className='back-icon' />
		</div>
	);
}

export default salary;
